@bot.command()
async def info(ctx, member: discord.Member = None):
    if member is None:
        member = ctx.message.author
    embed=discord.Embed(color=0x000666)
    embed.set_author(name=member.name + '#' + member.discriminator, icon_url=member.avatar_url)
    embed.add_field(name='Nickname', value=member.nick, inline=True)
    rolez = ", ".join(r.name for r in member.roles)
    rolelist = rolez.replace('@everyone,', '')
    rolecount = rolelist.count(',')
    embed.add_field(name='Activity', value=member.activity, inline=True)
    embed.add_field(name='Status', value=member.status, inline=True)
    embed.add_field(name='Roles: {}'.format(rolecount + 1), value=rolelist, inline=True)
    embed.add_field(name='Created Account', value=member.created_at, inline=True)
    embed.add_field(name='Joined', value=member.joined_at, inline=True)
    embed.set_thumbnail(url=member.avatar_url)
    await ctx.send(embed=embed)

