@bot.command()
async def pinv(ctx):
    y, z = 0, 10
    path = 'D:/Ice/Ice/Coding/Learning Code/Curel/Test Files/pokemonavedata.db'
    conn = sqlite3.connect(path)
    cursor = conn.cursor()
    useridstring = str(ctx.message.author.id)
    useridcontent = 'UserID{}'.format(useridstring)
    rowcount = "SELECT COUNT(*) FROM {}".format(useridcontent)
    lit = pd.read_sql_query("SELECT * FROM {}".format(useridcontent), conn)
    lol = cursor.execute(rowcount).fetchone()[0]
    okay = '**They own a total of {} Pokemon!**'.format(lol)
    sweet = lit.set_index("__Obtained_Pokemon__")
    sweet.index.name = None
    embed = discord.Embed(title="{}'s Inventory!".format(ctx.message.author.name), color=0x000666)
    embed.add_field(name=okay, value=sweet[:10].to_string(header=False))
    streakzz = await ctx.send(embed=embed)
    if lol > 10:
        await streakzz.add_reaction('⬅')
        await streakzz.add_reaction('➡')
        def check(reaction: discord.Reaction, adder: discord.User) -> bool:
            if adder == ctx.message.author and reaction.emoji == '➡':
                return True
            if adder == ctx.message.author and reaction.emoji == '⬅':
                return True
        reaction, adder = await bot.wait_for('reaction_add', timeout=15.0, check=check)
        while isinstance(reaction.emoji, str):
            if reaction.emoji == '⬅':
                if y == 0:
                    reaction, adder = await bot.wait_for('reaction_add', timeout=20.0, check=check)
                if y == 10:
                    embed = discord.Embed(title="{}'s Inventory!".format(ctx.message.author.name), color=0x000666)
                    embed.add_field(name=okay, value=sweet[:10].to_string(header=False))
                    await streakzz.edit(embed=embed)
                    reaction, adder = await bot.wait_for('reaction_add', timeout=20.0, check=check)
                    y, z = 10, 20
                elif 10 < y < lol:
                    y = y - 10
                    z = z - 10
                    embed = discord.Embed(title="{}'s Inventory!".format(ctx.message.author.name), color=0x000666)
                    embed.add_field(name=okay, value=sweet[y:z].to_string(header=False))
                    await streakzz.edit(embed=embed)
                    reaction, adder = await bot.wait_for('reaction_add', timeout=20.0, check=check)
            if reaction.emoji == '➡':
                y = y + 10
                z = z + 10
                if y > lol:
                    y, z = 10, 20
                    embed = discord.Embed(title="{}'s Inventory!".format(ctx.message.author.name), color=0x000666)
                    embed.add_field(name=okay, value=sweet[:10].to_string(header=False))
                    await streakzz.edit(embed=embed)
                    reaction, adder = await bot.wait_for('reaction_add', timeout=20.0, check=check)
                if y < lol:
                    embed = discord.Embed(title="{}'s Inventory!".format(ctx.message.author.name), color=0x000666)
                    embed.add_field(name=okay, value=sweet[y:z].to_string(header=False))
                    await streakzz.edit(embed=embed)
                    reaction, adder = await bot.wait_for('reaction_add', timeout=20.0, check=check)



